import React from 'react';
import { Menu, Icon } from "semantic-ui-react";

export function AdminMenu() {
  return (
    <Menu fluid vertical icon text className='admin-menu'>
        <Menu.Item>
            <Icon name="user outline" />>
        </Menu.Item>
    </Menu>
  )
}
